const LoadingScreen = () => {
  return (
    <div className="loading-screen">
      <img id="deadCatLoad" src="/images/deadCatLogo.png" alt="Dead Cat Logo" />
      <h2>Loading</h2>
    </div>
  );
};

export default LoadingScreen;
